selector_to_html = {"a[href=\"#solutions-of-exercise-2-5\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 2.5<a class=\"headerlink\" href=\"#solutions-of-exercise-2-5\" title=\"Link to this heading\">#</a></h1><p>We are trying to design the controller for the system:</p>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><h4>Computing the Routh table<a class=\"headerlink\" href=\"#computing-the-routh-table\" title=\"Link to this heading\">#</a></h4><p>The characteristic polynomial of the closed-loop system is the denominator of <span class=\"math notranslate nohighlight\">\\(G_c(s)\\)</span>:</p>", "a[href=\"#computing-the-routh-table\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Computing the Routh table<a class=\"headerlink\" href=\"#computing-the-routh-table\" title=\"Link to this heading\">#</a></h4><p>The characteristic polynomial of the closed-loop system is the denominator of <span class=\"math notranslate nohighlight\">\\(G_c(s)\\)</span>:</p>", "a[href=\"#assessing-the-stability-with-the-routh-criterion\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Assessing the stability with the Routh criterion<a class=\"headerlink\" href=\"#assessing-the-stability-with-the-routh-criterion\" title=\"Link to this heading\">#</a></h4><p>According to the Routh criterion, the system is stable if the element in the first column are all strictly positive.</p><p><span class=\"math notranslate nohighlight\">\\(\n\\begin{dcases}\n1 &gt; 0 &amp; (A) \\\\\n8 &gt; 0 &amp; (B) \\\\\n\\frac{135-5K}{8}  &gt; 0 \\qquad &amp; (C) \\\\\n\\frac{ 3375 + 230K - 25K^2}{135 - 5K} \\qquad &amp; (D)\\\\\n5K &gt; 0 &amp; (E)\n\\end{dcases}\n\\)</span></p>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>The closed-loop transfer function is given by:</p>", "a[href=\"exercise-2.2-solutions.html#ref-lec2-ex2-sol\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 2.2<a class=\"headerlink\" href=\"#solutions-of-exercise-2-2\" title=\"Link to this heading\">#</a></h1><p>We want to control the angular position of a DC motor. The transfer function between the applied voltage and the position is</p>", "a[href=\"#computing-the-interval\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\">Computing the interval<a class=\"headerlink\" href=\"#computing-the-interval\" title=\"Link to this heading\">#</a></h4><p>We can finally reconstruct the system of inequalities (A)-(E)</p><p><span class=\"math notranslate nohighlight\">\\(\n\\begin{dcases}\n\\forall K \\\\\n\\forall K \\\\\nK &lt; 27 \\\\\n -7.9 &lt; K &lt; 17.1 \\cup K &gt; 27 \\\\\nK &gt; 0\n\\end{dcases}\n\\)</span></p>", "a[href=\"#equation-eq-lec2-ex5-c-coeff\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec2-ex5-c-coeff\">\n\\[\\begin{split}\nc_{k} = \\frac{1}{b_0} \\textrm{det} \\begin{bmatrix} b_0 &amp; b_{k+1} \\\\ a_0 &amp; a_{k+1} \\end{bmatrix} = \\frac{b_0 \\cdot a_{k+1} - b_{k+1} \\cdot a_0}{b_0}\n\\end{split}\\]</div>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>The closed-loop transfer function is given by:</p>"}
